import React, { Component } from "react";
import { observer } from "mobx-react";

const App = observer(
  class App extends Component {
    render() {
      return (
        <div className="App">
          <h1>{this.props.store.todos[0]}</h1>
        </div>
      );
    }
  }
);

export default App;
